import React, { PureComponent } from 'react';
const PdfTest = () => {

  return (
    <main role="main" className="col-md-9 ml-sm-auto col-lg-10 pt-3 px-4">
      <h1>Test</h1>
      <PDFViewer>
        <MyDocument />
      </PDFViewer>

      <button>Generate PDF</button>
    </main>
  );
};

export default PdfTest;
